import logo from './logo.svg';
import Navbar from './Components/Navbar';
import './App.css';
import {Route,Routes} from "react-router-dom";
import Home from "./Components/Home";


function App() {

  return (
    <>

    <Navbar />
    <Routes>
    <Route path="/" element={<Home />} />
    </Routes>
    </>
  );
}

export default App;
